import React from 'react';
import {BrowserRouter, Route, Switch} from "react-router-dom";
import App from "./App";
import Dash from "./Dash";

const Router = () => (
    <BrowserRouter>
        <Switch>
            <Route exact path="/" component={App} />
            <Route exact path="/dash" component={Dash} />
        </Switch>
    </BrowserRouter>
);

export default  Router;
